(38, 'Записка', '1962 г.', '3 сентября 1962 г.', 'Мунозеро', 'Петрозаводск', 'Записка председателя президиума Верховного Совета Карельской АССР П. С. Прокконена в Президиум Верховного Совета РСФСР о переименовании Мунозерского сельсовета в Петровский в связи с тем, что на карельском языке это название имеет непристойный смысл', 66, 'Отпуск', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-03-25 15:34:25', 'нет', 'Прокконен П. С.', NULL, NULL, NULL),
