(48, 'Постановление', '3 апреля 1936 г.', '14 июля 1936 г.', 'Баренцово море', 'Петрозаводск', 'Постановление Совета Народных Комиссаров Автономной Карельской ССР об оказании помощи рыбацким колхозам Сорокского района и семьям рыбаков, погибших в Баренцевом море', 43, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-03-30 10:37:26', 'Имеется список рыбаков колхозов \"Беломор\" (Нюхча), \"Заря Севера\" (Колежма), имени Нуортева (Сорока).', 'нет', NULL, NULL, NULL),
(49, 'Отношение', '1884 г.', '10 декабря 1884 г.', 'Петрозаводский уезд', 'Петрозаводск', 'Отношение Петрозаводского уездного по крестьянским делам присутствия Шуйскому волостному правлению о переходе крестьян Виданского и Ялгубского обельных обществ из ведения полиции в ведение крестьянских учреждений', 44, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-03-30 14:14:06', 'Крестьяне были причислены к числу государственных крестьян и обложены местным сбором на содержание волостных управлений с сохранением за ними всех других льгот.\r\nКрестьяне Рябоевы, проживавшие в Виданском обществе, были причислены к государственным крестьянам на общем основании.\r\nНаравне с государственными крестьянами, обельные стали получать паспорта у местного старосты и обращаться с жалобами в волостной суд.', 'Рябоевы', NULL, NULL, NULL),
(50, 'Карточка', '21 января 1966 г.', '8 января 1966 г.', 'Швеция', 'Швеция', 'QSL-карточка (карта учета приема) радиоприемника Шведского DX-клуба DX-riksclub', 68, 'Подлинник', 'Английский', 'Типографский экземпляр, рукопись', 1, 'Соколов Александр Сергеевич', '2022-03-30 14:26:19', 'нет', 'нет', NULL, NULL, NULL),
(51, 'Прошение', '1904-1906 гг.', '27 мая 1906 г.', 'Сахалин, Олонецкая губерния, Петрозаводск', 'Корсаковский пост, Сахалин', 'Прошение крестьянина Корсаковского поста на о. Сахалине Семена Прокопьевича Пантелеева в Главное тюремное управление о возвращении на родину в Олонецкую губернию в связи с захватом поста японскими войсками и восстановлении его в правах', 46, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-03-30 14:30:52', '27 февраля 1904 г. он поступил в Третью дружину Корсаковского батальона и прослужил в ней 9 месяцев, за что получил право на свободное избрание места жительства. В 1884 г. во время нахождения на военной службе он оскорбил действием офицера, за что и был выслан на 3 года на о. Сахалин - л.3.', 'Пантелеев С. П.', NULL, NULL, NULL),
(52, 'Приказ', '1970 г.', '25 августа 1970 г.', 'Петрозаводск', 'Петрозаводск', 'Приказ директора завода \"Тяжбуммаш\" имени В. И. Ленина о выплате гонорара за разработку медальонов к сувенирному ключу \"Петрозаводскмаш\", \"Кивач\", \"Кижи\", \"Петрозаводск\", \"50 лет Советской Карелии\" и паспорт на произведение декоративно-прикладного искусства', 47, 'Подлинник', 'Русский', 'Машинопись, фотография', 1, 'Соколов Александр Сергеевич', '2022-03-30 14:37:36', 'Разработаны самодеятельным художником инженер-конструктором ОГК Валерием Петровичем Чеботаревым. С мая 1970 г. ключи выпускались заводом и реализовывались через магазины \"Росгалантереи\". Художнику было выплачено 100 руб. имеются изображения ключей.', 'Чеботарев В. П.', NULL, NULL, NULL),
(53, 'Договор', '9 апреля 1845 г.', '9 апреля 1845 г.', 'Петрозаводск', 'Петрозаводск', 'Договор мещанина г. Петрозаводска Григория Васильевича Таратайкина с Олонецким горным правлением о поставке камня с каменноборских ломок', 48, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-03-30 15:03:04', 'нет', 'Таратайкин Г. В.', NULL, NULL, NULL),
(54, 'Приказ', '1949 г.', '29 марта 1949 г.', 'Карело-Финская ССР', 'Петрозаводск', 'Приказ Комитета по делам физкультуры и спорта при Совете Министров Карело-Финской ССР об итогах розыгрыша кубка КФССР по русскому хоккею', 49, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-03-30 15:50:58', 'Участвовали сборные Олонецкого, Беломорского районов, г. Сортавалы, \"Динамо\", \"Локомотив\", \"Спартак\", ОДО. Сборная Кемского района дисквалифицирована, снялась. Кубок выиграла СО \"Спартак\", финалистом была СО \"Динамо\".', 'нет', NULL, NULL, NULL),
(55, 'Формулярный список', '1841-1856 гг.', '[1856 г.]', 'Российская империя', 'Петрозаводск', 'Формулярный список о службе сверштатного чиновника при канцелярии олонецкого губернатора Егора Егоровича Граммати', 50, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-03-30 16:04:45', 'Был в походе против неприятеля - 1 июля 1955 г. из Петрозаводска в окрестности Санкт-Петербурга, 11 июля к Бронной Горе, где находился при сооружении батарей и состоял в передовой линии ввиду неприятельского англо-французского флота, а 1 мая 1856 г. - вернулся в г. Петрозаводск. Имеет крест ополчения (по постанолвлению олонецкого губернского комитета ополчения был назначен в Олонецкую строевую № 1 дружину).', 'Граммати Е. Е.', NULL, NULL, NULL),
(56, 'Автобиография', '1930-1933 гг.', '29 июня 1933 г.', 'Автономная Карельская ССР', 'Петрозаводск', 'Автобиография инструктора по скайтингу Осоавиахима АКССР Ивана Семеновича Нярвяйнена', 51, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-03-30 16:10:39', 'Родился в д. Поги Тосненского района Ленинградской области. Участник Первой Мировой войны, Гражданской войны. Окончил Интернациональную военную школу. Член Егерской Карельской бригады до 1930 г. О смерти 6 февраля 1934 г. - см. Красная Карелия. 1934. 8 февраля.', 'Нярвяйнен И. С.', NULL, NULL, NULL),
(57, 'Письмо', '1850-1853 гг.', '1850-1853 гг.', 'Кронштадт, Ельведер, Рига', 'Кронштадт, Ельведер, Рига', 'Письма сумского мещанина Ивана Падорина, находившегося за границей 12 лет в качестве матроса иностранных судов, своим родственникам', 52, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-03-30 16:21:21', 'Иван Падорин прибыл в г. Архангельск на ганноверском судне \"Анна\" под именем Бертуса Крузе.', 'Падорин А. (Крузе Б.)', NULL, NULL, NULL),
