(198, 'Представление', '16 мая 1962 г.', '16 мая 1962 г.', 'Карело-Финская ССР, Карельская АССР', 'Петрозаводск', 'Представление заместителя председателя Совета Министров Карельской АССР А. Ястребова в Президиум Верховного Совета Карельской АССР о награждении Михаила Ивановича Гручина', 193, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-04-21 11:33:28', 'Михаил Иванович Гручин родился 5 июня 1912 г. в с. Кандалакше. В 1956 г. он окончил Высшую партийную школу при ЦК КПСС.\r\nВ 1931 г. окончил Кемскую рыбацко-промышленную профтехническую школу. Работал секретарем комитета строительства химкомбината, заведующим орготделом Кандалакшского райкома КПСС. С 1934 по 1936 гг. - служил на Военно-морском флоте, после - начальник школю юнг Министерства рыбной промышленности Карело-Финской ССР. В 1949 г. - инструктор политотдела Беломорско-Онежского пароходства. С 1956 г. - председатель исполкома Сегозерского, затем Кемского районных советов.', 'Ястребов А., Гручин М. И.', NULL, NULL, NULL),
