(383, 'Прошение', '3 октября 1908 г.', '3 октября 1908 г.', 'Олонецкая губерния', 'Каргополь', 'Прошение политического заключенного Каргопольской тюрьмы Карла Ивановича Лукса в Олонецкое губернское правление о выдаче добавочного содержания', 373, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-06-29 11:01:05', 'См. также писмо мещанки Елизаветы Степановны Григорьевой олонецкому губернатору о пособии от 29 мая 1908 г. - Ф. 2. Оп. 17. Д. 17/1603. Л. 119.', 'Лукс К. И., Григорьева Е. С.', NULL, NULL, NULL),
(384, 'Прошение', '27 июня 1908 г.', '27 июня 1908 г.', 'Повенецкий уезд', 'Повенецкий уезд', 'Прошение административного ссыльного Марьяна Якубовича Собчак повенецкому уездному исправнику о выдаче денег на одежду', 374, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-06-29 11:09:52', 'нет', 'Собчак М. Я.', NULL, NULL, NULL),
(385, 'Учетная карточка', '1941-1945 гг.', '21 мая 1980 г.', 'Петрозаводск', 'Петрозаводск', 'Учетная карточка ветерана Карельского фронта Константина Александровича Дворжицкого', 375, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-06-29 12:08:29', 'Родился 27 декабря 1912 г. в г. Петрозаводске. С июня 1941 г. по сентябрь 945 г. служил инструктором в политуправлении Карельского фронта. Подполковник.', 'Дворжицкий К. А.', NULL, NULL, NULL),
(386, 'Список', '1977-1978 гг.', '1978 г.', 'Карельская АССР', 'Петрозаводск', 'Список спортсменов РДЮСШ Госкомспорта Карельской АССР, занявших призовые места на чемпионатах и первенствах СССР', 376, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-06-29 13:57:29', 'Сергей Хлебников, 1955 года рождения, занял 3-е место на IV Зимней Спртакиаде народов СССР по конькобежному спорту на дистанции 500 м. Татьяна Игнатович, 1960 года рождения, заняла 1-е место в эстафете 4х5 км на IV Зимней Спртакиаде народов СССР по лжыным гонкам. Галина Голубева, 1961 года рождения занала 2-е место в эстафете 4х5 км в юношеском первенстве СССР по лыжным гонкам.', 'Хлебников С. А., Игнатович Т., Голубева Г', NULL, NULL, NULL),
(387, 'Ходатайство', '16 июня 1983 г.', '16 июня 1983 г.', 'Петрозаводск', 'Петрозаводск', 'Ходатайство ДЮСШ Петрозаводского дворца пионеров и школьников в Комитет по физической культуре и спорту при СМ Карельской АССР о присвоении тренееру-преподавателю по хоккею Валерию Борисовичу Барбашину высшей тренерской категории', 377, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-06-29 14:10:41', 'Выпускник тренера В. Б. Барбашина Андрей Карпин с сентября 1979 г. переведен в команду \"Динамо\" (Москва), в составе которой в 1980 г. занял 2-ое место в первенстве СССР по хоккею, в 1981 г. в составе юношеской сборной команды СССР стал чемпионом Европы, а в январе 1983 г. занял 1-е место на молодежном чемпионате мира.', 'Барбашин В. Б., Карпин А. Б.', NULL, NULL, NULL),
(388, 'Ходатайство', '31 октября 1983 г.', '31 октября 1983 г.', 'Петрозаводск', 'Петрозаводск', 'Ходатайство клуба юных моряков г. Петрозаводска в Государственный комитет Карельской АССР по физической культуре и спорту о присвоении звания тренера второй категории преподавателю по морскому многоборью Игорю Сергеевичу Лукину', 378, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-06-29 14:16:07', 'Имеется эмблема КЮМа.', 'Лукин И. С.', NULL, NULL, NULL),
