(392, 'Постановление', '1877 г.', '29 ноября 1877 г.', 'Олонецкая губерния', 'Петрозаводск', 'Постановление Олонецкого губернского распорядительного комитета по вопросу размещения военнопленных турок в случае их присылки в Олонекую губернию', 382, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-06-29 17:04:36', 'Планировалось прислать 500 турок, но от этих планов отказались. Городской голова Н. Ф. Пикин заявлял, что в г. Петрозаводске всего 859 домов, в числе которых весьма много таких, которые только носят названия дома, а в сущности - это хижины. Население города - 12 тысяч душ, т. е. на каждый дом - до 14 жителей. В Петрозаводск было выслано 114 семеств мятежников - горцев. Т. е. мест для размещения и продовольствия турок не было.', 'Пикин Н. Ф.', NULL, NULL, NULL),
