(470, 'Характеристика', '1941 г.', '1941 г.', 'Пиндуши', 'Пиндуши', 'Краткая характеристика работников начальствующего состава Пиндушской судоверфи', 458, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-22 14:28:19', 'В том числе характеристика на Константина Петровича Славинского - заведующего технологической группой судоверфи. Родился в 1880 г. в г. Кронштадте. Участник русско-японской войны, в т.ч. Цусимского сражения в составе экипажа броненосец \"Орел\". С 15 мая по декабрь 1905 г. - в плену в Японии. Участник Первой Мировой войны, в 1917 г. - генерал для поручений.\r\nОсужден по статье 17-58/6 сроком на 10 лет.', 'Славинский К. П.', NULL, NULL, NULL),
(471, 'Рапорт', 'октябрь 1941 г. - май 1942 г.', '17 мая 1942 г.', 'Карело-Финская ССР', 'Карело-Финская ССР', 'Рапорт начальника эшелона лихтера № 179 Александра Павловича Павлова директору Пиндушской судоверфи Борису Григорьевичу Фролову об эвакуации имущества, служащих и их семей, перевозке грузов с зазимовавшего лихтера в г. Беломорск', 459, 'Копия', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-22 14:45:34', 'нет', 'Павлов А. П., Фролов Б. Г.', NULL, NULL, NULL),
