(476, 'Постановление', '16 августа 1936 г.', '16 августа 1936 г.', 'Карельская АССР', 'Петрозаводск', 'Постановление Совета Народный Комиссаров Карельской АССР о реорганизации педегогических техникумов в Карелии', 464, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-25 16:40:33', 'В г. Петрозаводске организовывались Карельский школьный педагогический техникум, Карельский дошкольный педагогический техникум, Карельский физкультурно-трудовой техникум.\r\nДиректором школьного назначался Влапдимир Васильевич Девяткин, дошкольного и физкультурно-трудового - Эмиль Вильгельмович Маркконен.\r\nДошкольный и физкультурно-трудовой находились на улице Луначарского, 2, 4 и 6 (помещения бывшего техникума имени Покровского), школьного - на шоссе 1 МАя (бывший Карело-финский педтехникум). Были сохрарены филиалы в с. Ладве, туда переводились студенты Ухтинского педтехникума.', 'Девяткин В. В., Маркконен Э. В.', NULL, NULL, NULL),
