(501, 'Наградной лист', '14 февраля 1966 г.', '14 февраля 1966 г.', 'Прионежский район', 'Петрозаводск', 'Наградной лист к почетной грамоте Президиума Верховного Совета Карельской АССР на лесничего Шелтозерского лесничества Петра Алексеевича Башева', 489, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 14:53:32', 'Родился в 1918 г. в поселке Косалме. Работал лесничим с 1956 г.', 'Башев П. А.', NULL, NULL, NULL),
(502, 'Список', '1929 г.', '1929 г.', 'Петрозаводск', 'Петрозаводск', 'Состав футбольной команды совторгслужащих г. Петрозаводска', 490, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 14:58:00', 'В состав футбольной команды совторгслужащих г. Петрозаводска входили Н. Романов, М. Иванов, В. Богданов, Алешин, Ходотов, Маттилайнен, М. Селиверстов, М. Морозов, П. Чудинов, Федоров, Ерошкин.', 'Романов Н., Иванов М., Богданов В., Алешин, Ходотов, Маттилайнен, Селиверстов М., Морозов М., Чудинов П., Федоров, Ерошкин.', NULL, NULL, NULL),
(503, 'Приказ', '17-19 марта 1995 г.', '23 марта 1995 г.', 'Республика Карелия', 'Петрозаводск', 'Приказ Государственного комитета по физкультуре и спорту Республики Карелия об итогах первенства Карелии по волейболу', 491, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:01:32', 'Победители среди мужчин - Петрозаводск, среди женщин Сегежа.', 'нет', NULL, NULL, NULL),
(504, 'Квалификационный лист', '18 февраля 1982 г.', '18 февраля 1982 г.', 'Карельская АССР', 'Петрозаводск', 'Квалификационный лист на тренера по боксу Леонида Григорьевича Левина', 492, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:04:14', 'нет', 'Левин Л. Г.', NULL, NULL, NULL),
(505, 'Листок по учету кадров', '18 декабря 1969 г.', '18 декабря 1969 г.', 'Карельская АССР', 'Петрозаводск', 'Личный листок по учету кадров боксера Леонида Григорьевича Левина', 493, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:05:54', 'нет', 'Левин Л. Г.', NULL, NULL, NULL),
(506, 'Приказ', '1957 г.', '8 апреля 1957 г.', 'Карельская АССР', 'Петрозаводск', 'Приказ Комитета по физической культуре и спорту при Совете Министров Карельской АССР об итогах первенства Карелии по хоккею с шайбой', 494, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:07:58', 'Первое место - Динамо, второе место - ОДО, третье место - в/ч Пески.', 'нет', NULL, NULL, NULL),
(507, 'Приказ', '1950 г.', '27 февраля 1950 г.', 'Карело-Финская ССР', 'Петрозаводск', 'Приказ Комитета по делам физкультуры и спорта при Совете Министров Карело-Финской ССР об итогах розыгрыша первенства КФССР по хоккею с мячом', 495, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:10:00', 'Первое место - ХК \"Локомотив\" (Петрозаводск), второе - ОДО (Петрозаводск), третье \"Динамо\" (Петрозаводск). Также участвовали СО \"Динамо\" (Петрозаводск), \"Спартак\" (Петрозаводск), Госуниверитет, сборные Беломорска, Сегежи и Олонецкого района.', 'нет', NULL, NULL, NULL),
(508, 'Приказ', '1955 г.', '31 марта 1955 г.', 'Карело-Финская ССР', 'Петрозаводск', 'Приказ Комитета по делам физкультуры и спорта при Совете Министров Карело-Финской ССР об итогах розыгрыша первенства КФССР по хоккею с мячом', 496, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:17:31', 'Первое место - ХК \"Красная Звезда\" (Петрозаводск), тренер Н. П. Иванов, второе место СО \"Динамо\", третье место - Сегежский район. Также участвовали Медвежьегорский, Кондопожский, Кемский, Суоярвский районы, Надвоицы, \"Локомотив\" (Петрозаводск), \"Наука\" (Петрозаводск), \"Искра\" (Петрозаводск), Онегзавод, три команды ОДО.', 'Иванов Н. П.', NULL, NULL, NULL),
(509, 'Приказ', '1952 г.', '8 марта 1952 г.', 'Карело-Финская ССР', 'Петрозаводск', 'Приказ Комитета по делам физкультуры и спорта при Совете Министров Карело-Финской ССР об итогах розыгрыша первенства КФССР по хоккею с мячом', 497, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:20:43', '1 место - ОДО, второе - \"Красная Звезда\", третье - \"Спартак\" (Петрозаводск), четвертое - \"Динамо\", пятое - \"Локомотив\" (Петрозаводск), шестое - Госуниверситет, седьмое - Кемский район, восьмое - Сегежский район, девятое - Кондопожский район, десятое - Пудожский район, одиннадцатое - Олонецкий район.', 'нет', NULL, NULL, NULL),
(510, 'Приказ', '1954 г.', '27 марта 1954 г.', 'Карело-Финская ССР', 'Петрозаводск', 'Приказ Комитета по делам физкультуры и спорта при Совете Министров Карело-Финской ССР об итогах розыгрыша первенства КФССР по хоккею с мячом', 498, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:23:41', 'Первое место занял ОДО (Петрозаводск), второе - ДСО \"Красная Звезда\", третье - ДСО \"Локомотив\".\r\nТакже участвовали - в Сегежской зоне команды Сегежского, Кемского, Лоухского районов, в Кондопожской зоне - команды Кондопожского, Суоярвского, Сегозерского, Пудожского и Пряжинского районов. В финале встретились чемпион 1953 г. ОДО, сборные Кондопожского и Сегежского районов, Сортавалы ДСО \"Красная Звезда\" и \"Локомотив\".', 'нет', NULL, NULL, NULL),
(511, 'Приказ', '1953 г.', '9 марта 1953 г.', 'Карело-Финская ССР', 'Петрозаводск', 'Приказ Комитета по делам физкультуры и спорта при Совете Министров Карело-Финской ССР об итогах розыгрыша первенства КФССР по хоккею с мячом', 499, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:27:35', 'Первое место занял ОДО (Петрозаводск), второе - ДФСО \"Спартак\" (Петрозаводск), третье - СО \"Динамо\". Также участвовали \"Локомотив\", \"Красная Звезда\", Госуниверситет, \"Искра\", Кемский, Кондопожский, Сегежский, Суоярвский районы и Сортавала.', 'нет', NULL, NULL, NULL),
(512, 'Приказ', '1951 г.', '27 февраля 1951 г.', 'Карело-Финская ССР', 'Петрозаводск', 'Приказ Комитета по делам физкультуры и спорта при Совете Министров Карело-Финской ССР об итогах розыгрыша первенства КФССР по хоккею с мячом', 500, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:27:35', 'Первое место СО \"Локомотив\", второе - ДФСО \"Спартак\", третье - ОДО, четвертое  - Госуниверситет.', 'нет', NULL, NULL, NULL),
(513, 'Приказ', '1952', '12 февраля 1952 г.', 'Карело-Финская ССР', 'Петрозаводск', 'Приказ Комитета по делам физкультуры и спорта при Совете Министров Карело-Финской ССР об итогах розыгрыша кубка КФССР по хоккею с мячом', 501, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:31:24', 'Первое место -ОДО, финалист кубка СО \"Динамо\". Также участвовали команды Сегежского, Кондопожского, Суоярвского, Пудожского районов, Сортавалы, \"Локомотив\" (Петрозаводск), \"Спартак\" (Петрозаводск), \"Трудовые резервы\" (Петрозаводск), Госуниверситет, Петрозаводский домостроительный комбинат.', 'нет', NULL, NULL, NULL),
(514, 'Приказ', '1973 г.', '27 марта 1973 г.', 'Карельская АССР', 'Петрозаводск', 'Приказ Комитета по физкультуре и спорту при Совете Министров Карельской АССР об итогах первенства КАССР по хоккею с мячом', 502, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:33:42', 'ППервое место - ОТЗ, также участвовали команды Тяжбуммаша, Медвежьегорского и Питкярантского районов.', 'нет', NULL, NULL, NULL),
(515, 'Распоряжение', '1965 г.', '17 марта 1965 г.', 'Карельская АССР', 'Петрозаводск', 'Распоряжение Совета Союза спортивных обществ и организаций Карельской АССР об итогах первенства КАССР по хоккею с мячом', 503, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:35:52', 'ППервое место - ОТЗ, второе - ХК \"Автомобилист\" (Петрозаводск), третье - АРЗ-75.', 'нет', NULL, NULL, NULL),
(516, 'Таблица', '1987 г.', '1987 г.', 'Карельская АССР', 'Петрозаводск', 'Итоговая таблица чемпионата Карелии по хоккею с мячом 1987 г.', 504, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-07-29 15:38:06', 'Первое место - Петрозаводскбуммаш, второе - ОТЗ, третье - Авангард, четвертое - Буревестник (Петрозаводск), пятое - Петрозаводскстрой.', 'нет', NULL, NULL, NULL),
(517, 'Метрическая книга', '25 июля 1908 г.', '25 июля 1908 г.', 'Повенецкий уезд', 'Повенецкий уезд', 'Запись в метрической книге Челмужского прихода о рождении у обельного крестьянина д. Исаковской Андрея Алексеевича Ключарева дочери Анны', 505, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-08-26 09:52:09', 'Анна Андреевна Ключарёва (1909—1975) — депутат Верховного Совета СССР.', 'Ключарева А. А.', NULL, NULL, NULL),
(518, 'Ходатайство', '1958 г.', '29 сентября 1958 Г.', 'Маньга', 'Петрозаводск', 'Ходатайство заместителя министра культуры Карельской АССР С. В. Колосенка председателю Совета Министров Карельской АССР о назначении персональной пенсии Парасковье Ефимовне Архиповой из с. Маньга, послужившей прообразом для ряда работ скульптора С. Т. Коненкова', 506, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-08-26 10:01:35', 'Слепая старушка 97 лет.', 'Коненков С. Т., Колосенок С. В., Архипова П. Е.', NULL, NULL, NULL),
(519, 'Расписание', '29 ноября 1935 г.', '19 ноября 1935 г.', 'Медвежьегорский район', 'Медвежья Гора', 'Расписание движения пассажирских автобусов Беломорско-Балтийского комбината', 507, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-08-26 11:02:28', 'Маршрут № 1 Гостиница - вокзал, 4 рейса с 2-00 по 18-00, проезд 30 коп., маршрут № 2 Гостинца - Управление ББК, 3 рейса с 8-30 по 18-35, через угол Арнольдовского поселка, РИК, ЗРК, театр, вокзал, проезд 30 коп., маршрут № 3 Медвежья Гора - Лумбуши - Стройплощадка, 3 рейса в день, проезд 1 руб. от начала до конца, маршрут № 4 Медвежья Гора - Повенец, 3 рейсса в день, проезд 5 рублей.', 'нет', NULL, NULL, NULL),
(520, 'Приказ', '30 июля 1935 г.', '26 августа 1935 г.', 'Сорока', 'Медвежья Гора', 'Приказ Беломорско-Балтийского комбината о премировании работников комбината, участвовавших в спасении туристов при падении автобуса в воду на пристани Сорока', 508, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-08-26 12:30:22', 'Старший диспетчер пристани Сорока Михаил Филиппович Кутузов при участии мастера непарового флота Ивана Корнеевича Шамеца, судопропускника Костюк, шкипера каюка № 12 Василия Николаевича Васько, матроса пристани Сорока М. Н. Носкова спасли туристов - ударников учебы, находившихся у упавшем в воду автобусе при посадке пассажиров с парохода \"Горлица\" и направлявшихся из Ленинграда в Кировск. Кутузов извлек из воды всех 6 туристов, однако выжили лишь 4 из них.', 'Кутузов М. Ф., Шамец И. К., Костюк, Носов М. Н.', NULL, NULL, NULL),
(521, 'Приказ', '1935 г.', '25 июля 1935 г.', 'Петрозаводск', 'Медвежья Гора', 'Приказ Беломорско-Балтийского комбината о достройке в г. Петрозаводске на Онежском заводе буксиров \"Пионер\", \"Водник\", \"Чекист\", построенных верфью \"Спортсудостроитель\"', 509, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-08-26 15:08:34', 'нет', 'нет', NULL, NULL, NULL),
(522, 'Доклад', '1958-1962 гг.', '28 мая 1958 г.', 'Карельская АССР', 'Петрозаводск', 'Доклад министра сельского хозяйства Карельской АССР А. И. Кравченко заместителю министра сельского хозяйства РСФСР В. В. мемнонову о работах по землеустройству оленьих пастбищ и осставлению ведомостей оленеемкости на выпас 10-15 тысяч оленей в Карельской АССР к 1962 г.', 510, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-08-30 16:01:45', 'нет', 'Кравченко А. И., Мемнонов В. В.', NULL, NULL, NULL),
(523, 'Ходатайство', '1957-1958 гг.', '29 апреля 1958 г.', 'Карельская АССР', 'Петрозаводск', 'Ходатайство председателя Совета Министров Карельской АССР И. С. Беляева председателю Государственного комитета Совета Министров СССР по авиационной технике П. В. Дементьеву и начальнику Главного управления Гражданского воздушного флота П. Ф. Жигареву о строительстве пяти самолетов Як-12М в гидроварианте для нужд Карельской АССР', 511, 'Отпуск', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-08-30 16:18:32', 'В Карелии имелось мало сухопутных аэродромов, а гидросамолеты Ш-2 были списаны по выработке ресурса. В 1957 г. в г. Петрозаводске были проведены испытания самолета Як-12 на поплавках, самолет показал удовлетворительное качество.', 'Беляев И. С., дементьев П. В., Жигарев П. Ф.', NULL, NULL, NULL),
(524, 'Постановление', '1931 г.', '15 августа 1931 г.', 'Петрозаводск', 'Петрозаводск', 'Постановление Совета Народных Комиссаров Автономной Карельской ССР о строительстве аэродрома в г. Петрозаводске', 512, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-08-30 16:34:03', 'нет', 'нет', NULL, NULL, NULL),
(525, 'Характеристика', '1938-1982 гг.', '1982 г.', 'Беломорский район', 'Беломорск', 'Характеристика секретаря исполнительного комитета Беломорского районного совета на ветерана физкультуры и спорта Александра Филипповича Попова', 513, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-08-30 16:43:32', 'Александр Филиппович Попов начал выступать за сборные Беломорского района по футболу и хоккею с мячом с 1938 г.\r\nВ 1945-1946 гг. он был членом сборной команды по футболу стрелкового корпуса в Германии. В 1946 г. участвовал в первенстве г. Сталинграда по футболу. Серебряный призер чемпионата Карело-Финской ССР по футболу. С 1951 по 1953 гг. играл за команду \"Динамо\" (Петрозаводск) в футбол и хоккей с мячом.', 'Попов А. Ф.', NULL, NULL, NULL),
