(562, 'Личный листок', '1971 г.', '1971 г.', 'Карельская АССР', 'Карельская АССР', 'Личные листки по учету кадров заслуженных учителей профессионального технического образования РСФСР - директоров училищ Виктора Александровича Рогозина и Николая Михайловича Фепонова', 550, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-13 11:44:59', 'Имеется фото.', 'Рогозин В. А., Фепонов Н. М.', NULL, NULL, NULL),
(563, 'Торжественное обещание', '1922 г.', '1922 г.', 'Карельская Трудовая Коммуна', 'Карельская Трудовая Коммуна', 'Торжественное обещание беженца из Финляндии в Карельскую Трудовую Коммуну о работе на благо Советской Карелии', 551, 'Типографский экземпляр', 'Русский', 'Типографский экземпляр', 1, 'Соколов Александр Сергеевич', '2022-09-13 11:54:11', 'нет', 'нет', NULL, NULL, NULL),
(564, 'Положение', '6 апреля 1921 г.', '6 апреля 1921 г.', 'Олонецкая губерния, Карельская Трудовая Коммуна', 'Петрозаводск', 'Положение, утвержденное бюро производственной пропаганды и агитации при Карельско-Олонецком совете профсоюзов об агитпароходе, работающем на реке Свири и Онежском озере', 552, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-13 12:10:08', 'нет', 'нет', NULL, NULL, NULL),
(565, 'Протокол', '1921 г.', '1921 г.', 'Олонецкая губерния, Карельская Трудовая Коммуна', 'Петрозаводск', 'Протокол малого бюро пропаганды Карело-Олонецкого областного совета профсоюзов о плане работы агитпарохода \"Роза Люксембург\"', 553, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-09-13 12:13:20', 'Использовался для продналоговой земельной кампании и помощи голодающим Поволжья. Был разработан недельный маршрут с агитацией из Петрозаводска с постановкой спектакля на праздник Ильин день в Толвуе и Шуньге, далее в Повенце, с заходом на обратном пути в Типиницы и Кузаранду.', 'нет', NULL, NULL, NULL),
(566, 'Прошение', '1916 г.', '23 сентября 1916 г.', 'Петрозаводск', 'Петрозаводск', 'Прошение члена петрозаводского кружка любителей конькобежного спорта Александра Александровича Кутузова в Петрозаводскую городскую управу о разрешении устроить по примеру прошлых лет каток в Летнем саду ', 554, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-14 17:47:25', 'нет', 'Кутузов А. А.', NULL, NULL, NULL),
(567, 'Ходатайство', '1916 г.', '23 сентября 1916 г.', 'Петрозаводск', 'Петрозаводск', 'Ходатайство Щелкунова в Петрозаводскую городскую думу о продаже ему участка в местечке Пески между дорогой в Соломенное и Зеленой дорогой для строительства судоверфи', 555, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-14 17:50:28', 'нет', 'Щелкунов', NULL, NULL, NULL),
(568, 'Ходатайство', '1916 г.', '27 сентября 1916 г.', 'Петрозаводск', 'Петрозаводск', 'Ходатайство Александра Константиновича Гончаревского в Петрозаводскую городскую управу о выделении участка для строительства судоверфи и обучения учащихся яхтенно-моторному судостроительному делу', 556, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-14 17:52:35', 'А. К. Гончаревским было организовано яхтенно-моторное товарищество.', 'Гончаревский А. К.', NULL, NULL, NULL),
(569, 'Прошение', '1916 г.', '16 мая 1916 г.', 'Петрозаводск', 'Петрозаводск', 'Прошение крестьянки Александры Федоровны Денисовой в Петрозаводскую городскую управу о передаче в аренду земли около Сулажгорской речки', 557, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-15 09:30:40', 'нет', 'Денисова А. Ф.', NULL, NULL, NULL),
(570, 'Прошение', '30 сентября 1916 г.', '30 сентября 1916 г.', 'Петрозаводск', 'Петрозаводск', 'Прошение штурмана второго рахряда Николая павловича Варзугина в Петрозаводский общественный городской банк об освобождении его от обязанностей товарища директора банка по состоянию здоровья', 558, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-15 09:33:28', 'нет', 'Варзугин Н. П.', NULL, NULL, NULL),
(571, 'Прошение', '1916 г.', '20 апреля 1916 г.', 'Петрозаводск', 'Петрозаводск', 'Прошение петрозаводского казначея Павла Алексеевича Русакова в Петрозаводскую городскую управу об оставлении ему во владении пожни покойного брата Александра в Сальнаволоке', 559, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-15 09:56:44', 'нет', 'Русаокв А. А., Русаков П. А.', NULL, NULL, NULL),
(572, 'Рапорт', '1845 г.', '11 июля 1845 г.', 'Петрозаводск', 'Петрозаводск', 'Рапорт управителя Александровского завода А. П. Баранцова в Олонецкое горное правление о необходимости установки надолб от вновь выстроенного места до городской конюшни', 560, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-15 10:08:12', 'нет', 'Баранцов А. П.', NULL, NULL, NULL),
(573, 'Обращение', 'октябрь 1921 г.', '2 октября 1921 г.', 'Кемь', 'Кемь', 'Обращение Кемской уездной тройки помощи голодающим Поволжья о сборе продовольствия, денег, одежды срединаселения г. Кеми', 561, 'Типографский экземпляр', 'Русский', 'Типографский экземпляр', 1, 'Соколов Александр Сергеевич', '2022-09-15 10:17:36', 'нет', 'нет', NULL, NULL, NULL),
(574, 'Прошение', '1908 г.', '20 декабря 1908 г.', 'Паданы', 'Паданы', 'Прошение административно-ссыльного студента Санкт-Петербургского технологического института имени Николая I Эдуарда Петровича Дыклоп повенецкому уездному исправнику о выдаче пособия', 562, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-15 10:44:16', 'Окончил Двинское реальное училище в 1903 г., с 1904 г. - студент технологического института. Выслан в Паданы.', 'Дыклоп Э. П.', NULL, NULL, NULL),
(575, 'Формулярный список', '1906-1910 гг.', '1910 г.', 'Петрозаводск', 'Петрозаводск', 'Формулярный список о службе канцелярского чиновника петрозаводского казначейства Виктора Николаевича Лузгина', 563, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-15 16:14:31', 'нет', 'Лузгин В. Н.', NULL, NULL, NULL),
(576, 'Уведомление', '29 января 1918 г.', '19 февраля 1918 г.', 'Олонецкая губерния', 'Петрозаводск', 'Уведомление Олонецкой казенной палаты Петрозаводскому казначейству об упразднении административного отделения окружного суда, сиротских и коммерческих судей', 564, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-09-15 16:16:38', 'нет', 'нет', NULL, NULL, NULL),
(577, 'Свидетельство', '1897 г.', '7 сентября 1897 г.', 'Санкт-Петербург', 'Санкт-Петербург', 'Свидетельство Управления Ириновского узкоколейного железнодорожного пути Исидору Ивановичу Цолану о службе в должности поездного машиниста', 565, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-15 16:26:22', 'нет', 'Цолан И. И.', NULL, NULL, NULL),
(578, 'Указ', '1781 г.', '15 июля 1781 г.', 'Вытегорский уезд', 'Ногород', 'Указ Новгородского наместнического правления о претензии государственного крестьянина Петра Бонбина к английскому купцу Рексу за невыплату вознаграждения за поставленную им древесину для пильного завода на реке Усланке', 566, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-15 16:37:04', 'нет', 'Бонбин П., Рекс Т.', NULL, NULL, NULL),
(579, 'Отчет', '1918 г.', '1918 г.', 'Петрозаводский уезд', 'Петрозаводск', 'Отчет заведующего Петрозаводским уездным отделом здравоохрарения об эпидемии испанской болезни в Петрозаводском уезде', 70, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-15 17:05:47', 'нет', 'нет', NULL, NULL, NULL),
(580, 'Сообщение', '1819 г.', '19 декабря 1819 г.', 'Лодейное Поле', 'Санкт-Петербург', 'Сообщение управляющего исполнительной экспедицией Адмиралтейств-коллегии Ивана Пущина в Олонецкую палату уголовного суда о наложении взыскания на подрядчиков Лодейнопольской верфи', 567, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр Сергеевич', '2022-09-16 15:00:50', 'нет', 'Пущин И. П.', NULL, NULL, NULL),
(581, 'Ходатайство', '1977 г.', '1977 г.', 'Карельская АССР', 'Петрозаводск', 'Ходатайство предесеадателя правления Союза писателей Карелии Н. Г. Гиппиева в Карельский обком КПСС о представлении путевки в санаторий \"Марциальные воды\" финской писательницы Элли Стенберг', 568, 'Подлинник', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-09-16 15:17:04', 'Элли Стенберг родилась в 1903 г. Участница антифашисткой борьбы. Работала учительницей в Карелии. С 1945 по 1966 гг. была депутатом финского парламента от Демократического союза народов Финляндии.', 'Гиппиев Н. Г. (Лайне Н.), Стенберг Э.', NULL, NULL, NULL),
(582, 'Указ', '21 сентября 2002 г.', '21 сентября 2002 г.', 'Республика Карелия', 'Москва', 'Указ Президента Российской Федерации Владимира Владимировича Путина о награждении фотокорреспондента ИТАР-ТАСС Семена Ароновича Майстермана Орденом Почета', 569, 'Копия', 'Русский', 'Машинопись', 1, 'Соколов Александр Сергеевич', '2022-09-16 15:32:08', 'нет', 'Путин В. В., Майстерман С. А.', NULL, NULL, NULL),
(583, 'Диплом', '1974 г.', '1974 г.', 'Карельская АССР', 'Петрозаводск', 'Диплом лауреата государственной премии Карельской АССР за балет \"Кижская легенда\" народному артисту РСФСР Гельмеру-Райнеру Синисало и заслуженному деятелю искусств РСФСР Игорю Валентиновичу Смирнову', 570, 'Подлинник', 'Русский', 'Типографский экземпляр', 1, 'Соколов Александр', '2022-10-12 16:19:47', 'нет', 'Синисало Г.-Р. Н., Смирнов И. В.', NULL, NULL, NULL),
(584, 'Список', '1831 г.', '1831 г.', 'Петрозаводск', 'Петрозаводск', 'Список лиц, получающих пособие от Олонецкого епархивального попечительства о бедных духовного звания', 571, 'Подлинник', 'Русский', 'Рукопись', 1, 'Соколов Александр', '2022-10-12 17:24:50', 'нет', 'нет', NULL, NULL, NULL),
(585, 'Приказ', '1936 г.', '25 сентября 1936 г.', 'Петрозаводск', 'Петрозаводск', 'Приказ по тресту \"Карелавто\" о борьбе за трудовую дисциплину в связи с катастрофой на переезде Петрозаводск-Пряжа', 572, 'Копия', 'Русский', 'Машинопись', 1, 'Соколов Александр', '2022-10-14 15:07:30', 'В нось с 11 на 12 сентября 1936 г. с пассажирской машиной Петрозаводской автобазы ГАЗ-АА № 369 под управлением шофера Пекшуева произошла катастрофа на тракте Петрозаводск-Пряжа, столкновение с товарным поездом. Из-за Пекшуева, решившего проскочить, 3 человека погибло, 5 тяжело ранено, машина сгорела.', 'Пекшуев', NULL, NULL, NULL),
(586, 'Протокол', '2 августа 1997 г.', '2 августа 1997 г.', 'Петрозаводск', 'Петрозаводск', 'Протокол судьи матча на кубок России в зоне Северо-Запад В. Л. Петтая между юношескими командами \"Балтика\" (Калиниград) и \"Зенит (Санкт-Петербург) в г. Петрозаводске', 573, 'Копия', 'Русский', 'Рукопись', 1, 'Соколов Александр', '2022-10-14 15:18:20', 'нет', 'Петтай В. Л.', NULL, NULL, NULL),
